'rtc/resources/rich_text_component/nls/nonlocalVariableMessages':{"globalExtendedTooltipMessage":"<strong>Additional Information</strong><br/><p>A variable declared as global in multiple functions (and optionally the base workspace) share a single copy of that variable. Any assignment you make to that variable in one function is available to all functions that declare it global.</p><p>If you intentionally use a variable in this manner, it is not a problem. </p><p>However, if you unintentionally use a variable in this manner, it can result in unexpected behavior. If the highlighting indicates that the scope of a variable spans multiple functions, and that was not your intent, remove the global declaration from the variable.</p><p>For more information on variables and the workspace, see <a href=\"matlab:helpview([docroot '/techdoc/matlab_prog/matlab_prog.map'],'global_variables')\" target=\"_blank\">Global Variables</a>.</p><br/>","globalTooltipMessage":"The scope of variable '${0}' is global. Changes to its value might span multiple workspaces.","persistentExtendedTooltipMessage":"<strong>Additional Information</strong><br/><p>A variable declared as persistent is local to the function in which you declare it; yet MATLAB retains its value in memory between calls to that function. Persistent variables are known only to the function in which you declare them. This prevents other functions or the MATLAB command line from changing the value of the persistent variable.</p><p> When you clear or modify a function that is in memory, MATLAB also clears all persistent variables declared by that function. To keep a function in memory until MATLAB quits, use <code><a href=\"matlab:doc mlock\" target=\"_blank\">mlock</a></code>. </p><p> MATLAB returns an error if:<ul><li><p>You attempt to declare a variable persistent and another variable with the same name exists in the current workspace. </p></li><li><p>You specify a variable as a function input or output argument, and then try to declare that variable as persistent within the same function. For example, the following persistent declaration is invalid: </p><p><code>function&nbsp;myfun(argA)<br/>persistent&nbsp;argA</code></p></li></ul></p><p>For more information on variables and the workspace, see <a href=\"matlab:helpview([docroot '/techdoc/matlab_prog/matlab_prog.map'],'persistent_variables')\" target=\"_blank\">Persistent Variables</a>.</p><br/>","persistentTooltipMessage":"The scope of variable '${0}' persists across calls to the same function.","usedAcrossFunctionsExtendedTooltipMessage":"<strong>Additional Information</strong><br/><p>Variables within nested functions are accessible to more than just their immediate function. A variable, <code>x</code>, to which you assign a value or use within a nested function resides in the workspace of the outermost function that both contains the nested function and accesses <code>x</code>. Therefore, the scope of <code>x</code> is the function to which this workspace belongs, and all functions nested to any level within that function.</p><p>If you intentionally use a variable in this manner, it is not a problem. For examples, see the MATLAB Programming Demo on Nested Functions.</p><p>However, if you unintentionally use a variable in this manner, it can result in unexpected behavior. If the highlighting indicates that the scope of a variable spans multiple functions, and that was not your intent, consider:</p><ul><li><p>Renaming the nested function variable so it does not match the outer function variable name.</p></li><li><p>Passing the variable into the function as an input argument instead of using the variable directly within the nested function.</p></li></ul><p>For more information, see <a href=\"matlab:helpview([docroot '/techdoc/matlab_prog/matlab_prog.map'],'nested_functions_scope')\" target=\"_blank\">Variable Scope in Nested Functions</a>.</p><br/>","usedAcrossFunctionsTooltipMessage":"The scope of variable '${0}' spans multiple functions.","_localized":{}}
,
